ReactDOMRe.renderToElementWithId(React.createElement(StudentCourse__Header.make, {
          currentCourseId: currentCourseId,
          courses: courses,
          additionalLinks: additionalLinks,
          coverImage: coverImage
        }), "course-header-root");

exports.decodeProps = decodeProps;
exports.currentCourseId = currentCourseId;
exports.courses = courses;
